import React from "react";
import Navbar from "react-bootstrap/Navbar";

const Nav = () => {
  return (
    <div>
      <Navbar className="bg-green-200" variant="dark">
        <Navbar.Brand href="#home">
          <img
            alt=""
            src="/logo.svg"
            width="30"
            height="30"
            className="d-inline-block align-top"
          />
          {" efe"}
          React Bootstrap
        </Navbar.Brand>
      </Navbar>
    </div>
  );
};

export default Nav;
